    console.log("test");
  };

  return (
    <span
      className={`${burgerConstructor.wrapper} pl-5`}
      onClick={handleBurgerClick}
    >
      <BurgerIcon type="primary" />
      <span className="text text_type_main-default"> Конструктор</span>
    </span>
  );
}

export default BurgerConstructor;
